void classifyWithXgboost::featureExtraction(const pcl::PointCloud<pcl::PointXYZI> &cloud_, Feature_ &features) {

    pcl::PointCloud<pcl::PointXYZI> points=cloud_;

    features.Pointnum=points.size(); //第一个feature

    float Interia_tensor[6]={0}; //第二个feature
    float cov_mat[3]={0};
    float x_avr=0;
    float y_avr=0;
    float z_avr=0;
    int IntensityNum[25]={0};

    for (int i = 0; i <points.size() ; ++i) {
        Interia_tensor[0] +=(points[i].x)*(points[i].x)+(points[i].y)*(points[i].y);
        Interia_tensor[1] -=(points[i].x)*(points[i].y);
        Interia_tensor[2] -=(points[i].x)*(points[i].z);
        Interia_tensor[3] +=(points[i].x)*(points[i].x)+(points[i].z)*(points[i].z);
        Interia_tensor[4] +=(points[i].y)*(points[i].z);
        Interia_tensor[5] +=(points[i].y)*(points[i].y)+(points[i].y)*(points[i].y);

        x_avr+=points[i].x;
        y_avr+=points[i].y;
        z_avr+=points[i].z;

        int indexI=points[i].intensity/10;
        if (indexI>=0&&indexI<25){
            IntensityNum[indexI]++;
        }

    }

    for (int i = 0; i <6 ; ++i) {
        features.Inertia_tensor[i]=Interia_tensor[i];
    }

    //第三个feature
    x_avr /=features.Pointnum;
    y_avr /=features.Pointnum;
    z_avr /=features.Pointnum;

    for (int i = 0; i <points.size() ; ++i) {
        cov_mat[0] +=(points[i].x-x_avr)*(points[i].y-y_avr);   //xy
        cov_mat[1] +=(points[i].x-x_avr)*(points[i].z-z_avr);   //xz
        cov_mat[2] +=(points[i].y-y_avr)*(points[i].z-z_avr);   //yz
    }

    for (int j = 0; j <3 ; ++j) {
        cov_mat[j] /=(features.Pointnum-1);
        features.Cov_mat[j]=cov_mat[j];
    }

    Eigen::Matrix3f C;
    C(0,0)=C(1,1)=C(2,2)=1;
    C(0,1)=C(1,0)=cov_mat[0];
    C(0,2)=C(2,0)=cov_mat[1];
    C(1,2)=C(2,1)=cov_mat[2];
    Eigen::EigenSolver<Eigen::Matrix3f> es(C);
    Eigen::Matrix3f D=es.pseudoEigenvalueMatrix();



    //第四个feature
    float eigenvalue[6]={0};
    float eigenvalue_sum={0};
    for (int i = 0; i <3 ; ++i) {
        if (fabs(D(i,i))<0.0001){
            eigenvalue[i]=0;
        } else{
            eigenvalue[i]=D(i,i);
        }
        eigenvalue_sum +=eigenvalue[i];
    }

    for (int j = 0; j <3 ; ++j) {
        for (int k = 0; k <(3-j-1) ; ++k) {
            if (eigenvalue[k]<eigenvalue[k+1]){
                float temp_ =eigenvalue[k];
                eigenvalue[k]=eigenvalue[k+1];
                eigenvalue[k+1]=temp_;
            }
        }
    }

    if (eigenvalue_sum !=0){
        for (int i = 0; i <3 ; ++i) {
            eigenvalue[3+i]=eigenvalue[i]/eigenvalue_sum;
        }
    }

    for (int j = 0; j <6 ; ++j) {
        features.Cov_eigenvalue[j]=eigenvalue[j];
    }

    //第五个
    float width_,height_,length_,distance_,azimuth_;
    float max_x,min_x,max_y,min_y,max_z,min_z;

    //返回最大最小xyzi
    Eigen::Vector4f min_pt;
    Eigen::Vector4f max_pt;

    pcl::getMinMax3D(points,min_pt,max_pt);

    max_x=max_pt.x();
    max_y=max_pt.y();
    max_z=max_pt.z();
    min_x=min_pt.x();
    min_y=min_pt.y();
    min_z=min_pt.z();

    height_=max_z-min_z;
    width_=max_x-min_x;
    length_=max_y-min_y;
    distance_=sqrt((min_z + height_/2) * (min_z + height_/2)
                   + (min_x + width_/2) * (min_x + width_/2)
                   + (min_y + length_/2) * (min_y + length_/2));

    azimuth_ = atan2((min_y + length_/2), ((min_x + width_/2)) );

    features.Length=length_;
    features.Width=width_;
    features.Height=height_;
    features.distance=distance_;
    features.Azimuth=azimuth_;

    //第6个feature
    float z_con_avr[10]={0};
    float z_num[10]={10};
    float gap=(max_y-min_y)/10;

    for (int i = 0; i <points.size() ; ++i) {
        if (gap>0){
            int index_=(int) ((points[i].y-min_y)/gap);
            z_con_avr[index_] +=points[i].z;
        }
    }

    for (int j = 0; j <10 ; ++j) {
        if(z_num[j]!=0){
            z_con_avr[j] /=z_num[j];
        }
        features.Contour_vert[j]=z_con_avr[j];
    }

    for (int k = 0; k <25 ; ++k) {
        features.Intesity[k]=((float)IntensityNum[k])/(float)features.Pointnum;
    }


}

void classifyWithXgboost::xgboostClassification(Feature_ &sampleFeatures, vector<float> &result) {
    vector<float> test_sample;
    feature2Vec(sampleFeatures, test_sample);

    //分类
    if (test_sample.size() != feature_number_) {
        cout << "test sample feature num is not right" << endl;
    } else {
        result = xgb_classify(test_sample);
        result = get_probabilities(result);
    }
}

void classifyWithXgboost::feature2Vec(Feature_ &sampleFeature, vector<float> &featuretmp) {
    featuretmp.clear();
    Feature_ testFeature=sampleFeature;

    //pointnum
    featuretmp.push_back(testFeature.Pointnum);

    //inertia_tensor
    for (int i = 0; i < getArrayLen(testFeature.Inertia_tensor) ; ++i) {
        featuretmp.push_back(testFeature.Inertia_tensor[i]);
    }

    //cov_mat
    for (int i = 0; i < getArrayLen(testFeature.Cov_mat) ; ++i) {
        featuretmp.push_back(testFeature.Cov_mat[i]);
    }

    //Cov_eigenvalue
    for (int i = 0; i < getArrayLen(testFeature.Cov_eigenvalue) ; ++i) {
        featuretmp.push_back(testFeature.Cov_eigenvalue[i]);
    }

    //Contour_vert
    for (int i = 0; i < getArrayLen(testFeature.Contour_vert) ; ++i) {
        featuretmp.push_back(testFeature.Contour_vert[i]);
    }

    //wid
    featuretmp.push_back(testFeature.Width);
    //length
    featuretmp.push_back(testFeature.Length);
    //height
    featuretmp.push_back(testFeature.Height);
    //distance
    featuretmp.push_back(testFeature.distance);
    //azimuth
    featuretmp.push_back(testFeature.Azimuth);

    //Intesity
    for (int i = 0; i < getArrayLen(testFeature.Intesity) ; ++i) {
        featuretmp.push_back(testFeature.Intesity[i]);
    }

}

vector<float> classifyWithXgboost::get_probabilities(vector<float> &log_probabilities){
    float sum=0;
    std::vector<float> probabilities (log_probabilities.size(), 0);

    for (std::vector<float>::const_iterator i = log_probabilities.begin(); i != log_probabilities.end(); ++i) {
        sum += exp(*i);
    }

    for (unsigned int i = 0; i < log_probabilities.size(); i++) {
        probabilities[i] = exp(log_probabilities[i]) / sum;
    }

    return probabilities;

}

